import React from 'react';
import { Container, Row, Button } from 'reactstrap';
import { NavLink, Link } from 'react-router-dom';

const nav__link = [
  {
    Path: '/home',
    display: 'Home',
  },
  {
    Path: '#',
    display: 'About',
  },
  {
    Path: '/tour',
    display: 'Tour',
  },
];

const Header = () => {
  return <div>Header</div>;
};

export default Header;
